"use strict";

const accumulate = require('itertools').accumulate;

function f_gold(trips, capacity) {
    const delta = new Array(1001).fill(0);
    for (let i = 0; i < trips.length; i++) {
        const [num, start, end] = trips[i];
        delta[start] += num;
        delta[end] -= num;
    }
    return accumulate(delta).every(s => s <= capacity);
}
